Race Cars

Technology Documentary hosted by William Hootkins, published by Discovery Channel broadcasted as part of DC Extreme Machines series in 1996 - English narration


Information
------------------------------

Extreme Machines is dedicated to finding out how machines work. Follow the Indy car Tasman team and a GTR race team and experience their successes and failures throughout the season. Highlights include both the engineering and operational differences between these different race formulas. This program also examines all aspects of technical testing from brakes to engines and crash tests.

